    false,nt"url": null,nt"notes": "Digital orthographic imagery datasets contain
    georeferenced images of the Earth's surface, collected by a sensor in which object
    displacement has been removed for sensor distortions and orientation, and terrain
    relief. Digital orthoimages have the geometric characteristics of a map, and image
    qualities of a photograph. (Source: Circular A-16, p. 16). These files are color
    digital areal photos taken in the year 2009.They consist of 2,733 12x12-kilometer
    tiles that cover the entire state of Montana. They are orthorectified natural-color
    MrSID images with a ground resolution of 1 meter, and they are registered to the
    Montana State Plane coordinate system, NAD83, unit meters.",nt"owner_org":
